<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./index.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Lalezar:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Martel Sans:wght@400&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Lucida Console:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="desktop-1">
      <img
        class="kali-linux-backtrack-linux-lin-icon"
        alt=""
        src="./public/kalilinuxbacktracklinuxlinuxhdwallpaperpreview-1@2x.png"
      />

      <div class="notebook-kali-2022-1"></div>
      <section class="image-1-wrapper">
        <img
          class="image-1-icon"
          loading="eager"
          alt=""
          src="./public/image-1@2x.png"
        />
      </section>
      <section class="frame-i-phone-unlock">
        <div class="ios-unlocking-scripting-tool-wrapper">
          <h2 class="ios-unlocking-scripting">
            IOS UNLOCKING SCRIPTING TOOL & CODE
          </h2>
        </div>
        <div class="parent-frame-i-phone">
          <div class="rectangle-i-phone-mini">
            <div class="prev">&lt;&lt;prev</div>
            <div class="frame-i-phone-mini">
              <div class="frame-i-phone-plus">
                <div class="frame-i-phone-prox">
                  <div class="framei-phone-prox">
                    <div class="rectangle-i-phone-logo">
                      <img
                        class="pngwing-1-icon"
                        alt=""
                        src="./public/pngwing-1@2x.png"
                      />

                      <img
                        class="pngwing-5-icon"
                        loading="eager"
                        alt=""
                        src="./public/pngwing-1@2x.png"
                      />
                    </div>
                  </div>
                  <div class="iphone-11promaxscriptpy-42">
                    IPHONE 11/PRO/MAX
                    .script.py 42.5$
                  </div>
                </div>
                <div class="framesi-phone-components">
                  <img
                    class="pngwing-2-icon"
                    loading="eager"
                    alt=""
                    src="./public/pngwing-1@2x.png"
                  />

                  <div class="iphone-12miniproscriptpy-5">
                    IPHONE 12/MINI/PRO
                    .script.py 54.2$
                  </div>
                </div>
                <div class="framenext-button">
                  <div class="i-phone-max-script-frame">
                    <div class="i-phone-mini-pro-script-frame">
                      <img
                        class="pngwing-3-icon"
                        loading="eager"
                        alt=""
                        src="./public/pngwing-1@2x.png"
                      />
                    </div>
                    <div class="iphone-13miniproscriptpy-5">
                      IPHONE 13/MINI/PRO
                      .script.py 50.2$
                    </div>
                  </div>
                </div>
                <div class="framesi-phone-components1">
                  <img
                    class="pngwing-4-icon"
                    loading="eager"
                    alt=""
                    src="./public/pngwing-1@2x.png"
                  />

                  <div class="iphone-14plus-scriptpy-container">
                    <p class="iphone-14plus">IPHONE 14/PLUS.</p>
                    <p class="scriptpy-502">script.py 50.2$</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="next">next&gt;&gt;</div>
      </section>
    </div>
  </body>
</html>
